import React, { Component } from 'react';

import ProteinViewer from './ProteinViewer'
import DomainViewer from './DomainViewer'
import SequenceViewer from './SequenceViewer'

function stringGen(len){
    var text = " ";
    var charset = "WHKRQNEDSTGPAVLIMCFY";

    for( var i=0; i < len; i++ )
        text += charset.charAt(Math.floor(Math.random() * charset.length));

    return text;
}
let sequence = '';

class App extends Component {
  onNucleotideClick (nucleotide){
        console.log(nucleotide);
  }
  render() {
    //let sequence = stringGen(600);
    return (
      <div className="App">
        <ProteinViewer />
        <DomainViewer />
        <SequenceViewer sequence={sequence} onNucleotideClick={this.onNucleotideClick}/>
      </div>
    );
  }
}

export default App;
